import React from 'react';
import './App.css';
import Sublist from './Component/Sublist';
import Wbnx2 from './Component/Wbnx2';
import Wbnx3 from './Component/Wbnx3';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
function App() {
  return (
    <Router>
      <div className="App">
        <SubList/>
        <Switch>
          <Route path="/Wbnx1">
            <Wbnx1/>
          </Route>
          <Route path="/Wbnx2">
            <Wbnx2/>
          </Route>
          <Route path="/Wbnx3">
            <Wbnx3/>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
